    const [,setLoading] = useContext(LoadingContext);
    useEffect(() => {
        setLoading(false)
      },[]);

    useEffect(() => {
        return () => {
          console.log('will unmount');
        }
      }, []);

      return (

        <div className="wrapper">
            <div className="container-fluid">
                <div className="row">
                    <div className="col-12">
                        <div className="card">
                            <div className="card-body">         
                                <div>
                                    <p>Index</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )

}

export default Index
